__NUXT_JSONP__("/about", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p){return {data:[{bios:[{slug:i,name:"Jonathan Neitzell",intro:j,level:1,role:"Managing Partner",link:i,linkedinProfileLink:"https:\u002F\u002Fwww.linkedin.com\u002Fin\u002Fjon-neitzell-1ba3172\u002F",image:"jonathan-neitzell-bw",tags:[k,e,l,"Founder"],toc:[],body:{type:f,children:[{type:b,tag:c,props:{},children:[{type:a,value:j}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"Previously, Jon served as the Chief Data Officer at Goldman Sachs Fundamental Equities. This was the first appointed role in the Asset Management Division recognizing Jon’s data driven approach as Portfolio Manager on the Technology Opportunities Fund demonstrating industry leading return on invested capital metrics (AUM growth during firm tenure from ~$600M to $4B)."}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"Jon holds a BA in Business Administration from the University of St. Thomas, an MBA from the University of Chicago, and is a graduate of the MIT Sloan School of Management executive program in Artificial Intelligence: Implications for Business Strategy."}]}]},dir:g,path:"\u002Fbios\u002Fjonathan-neitzell",extension:h,createdAt:"2021-08-19T13:33:15.944Z",updatedAt:"2021-08-30T22:07:45.951Z",readingTime:46400,bodyText:"\u003Cp\u003EJon is the founder of Anduril Partners, an investment and advisory firm focused on the application of data-driven processes. Jon has over 20 years of technology and financial services experience as a portfolio manager, chief data officer, and has served on several board and in advisory roles, including Aiera (advanced, self-learning models, augmented with human insights), Arbor Advisory Group (Investor Relations and Corporate Communications), Aptiviti (360-degree due diligence platform for decision makers), Connacht Asset Management, Crux Informatics (ETL delivery platform for normalized data ingestion), Equity Data Science (decision workflow platform), and SESAMm (modular machine learning engine for signal and investment strategy creation). He recently served as a board advisor for Prattle (investment research through quantifying language - acquired by Liquidnet), and for Kensho Technologies (artificial intelligence for financial services) the largest acquisition of its kind by S&amp;P Global.\u003C\u002Fp\u003E\n\u003Cp\u003EPreviously, Jon served as the Chief Data Officer at Goldman Sachs Fundamental Equities. This was the first appointed role in the Asset Management Division recognizing Jon’s data driven approach as Portfolio Manager on the Technology Opportunities Fund demonstrating industry leading return on invested capital metrics (AUM growth during firm tenure from ~$600M to $4B).\u003C\u002Fp\u003E\n\u003Cp\u003EJon holds a BA in Business Administration from the University of St. Thomas, an MBA from the University of Chicago, and is a graduate of the MIT Sloan School of Management executive program in Artificial Intelligence: Implications for Business Strategy.\u003C\u002Fp\u003E\n"},{slug:m,name:"Scott Stanley",intro:n,level:2,role:e,link:m,linkedinProfileLink:"https:\u002F\u002Fwww.linkedin.com\u002Fin\u002Fstanleysd\u002F",image:"scott-stanley-bw",tags:["Anduril Partners",l],toc:[],body:{type:f,children:[{type:b,tag:c,props:{},children:[{type:a,value:n}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"Prior to joining the big four, he spent 18 years as an entrepreneur. The first ten of these years were spent growing Chatham Financial, a global risk advisory firm. He was one of the first five employees who worked together over a garage in the middle of a cornfield in rural Pennsylvania. Scott played a key role on this leadership team, helping it grow globally to over 250 employees with revenues rising from under 1 million to over 100 million with national trading volume surpassing one trillion USD in just ten years."}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"In response to this tremendous growth, Scott led efforts to increase scale and opened offices in London, Krakow and Denver. He launched a capital advisor division, and led the IT division. Scott’s passion for developing future leaders led him to co-found Chatham’s Leadership University, which focuses on building the leadership capacity of emerging junior to mid-level leaders."}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"Following Chatham Financial, Scott launched several enterprises. Some of these businesses focused on traditional finance\u002Fconsulting, while others, like, The A-Listers, were aimed at the entertainment industry providing services to help build the brand of individual artists. While running The A-Listers, he worked with Flo Rida, Cee Lo Green and B.o.B."}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"Scott graduated from the United States Military Academy at West Point with a BS in Mechanical Engineering. He also served as an Airborne Ranger in the United States Army, spending most of his time in Germany as a platoon leader and company commander."}]}]},dir:g,path:"\u002Fbios\u002Fscott-stanley",extension:h,createdAt:"2021-08-19T13:33:15.882Z",updatedAt:"2021-08-30T22:07:45.948Z",readingTime:64600,bodyText:"\u003Cp\u003EBefore returning to his entrepreneurial roots in 2020, Scott most recently spent seven years in Big Four consulting, primarily with KPMG covering large global banks. At KPMG, he drove innovation and technology initiatives and led engagements within the firm's risk practices. He established and led FinTech initiatives and partnered with best-in-class technology software companies to create joint go-to-market opportunities. He also developed an AI\u002FNLP software solution that accelerated and improved the quality of the audit\u002Freview of large volumes of technical documents.\u003C\u002Fp\u003E\n\u003Cp\u003EPrior to joining the big four, he spent 18 years as an entrepreneur. The first ten of these years were spent growing Chatham Financial, a global risk advisory firm. He was one of the first five employees who worked together over a garage in the middle of a cornfield in rural Pennsylvania. Scott played a key role on this leadership team, helping it grow globally to over 250 employees with revenues rising from under 1 million to over 100 million with national trading volume surpassing one trillion USD in just ten years.\u003C\u002Fp\u003E\n\u003Cp\u003EIn response to this tremendous growth, Scott led efforts to increase scale and opened offices in London, Krakow and Denver. He launched a capital advisor division, and led the IT division. Scott’s passion for developing future leaders led him to co-found Chatham’s Leadership University, which focuses on building the leadership capacity of emerging junior to mid-level leaders.\u003C\u002Fp\u003E\n\u003Cp\u003EFollowing Chatham Financial, Scott launched several enterprises. Some of these businesses focused on traditional finance\u002Fconsulting, while others, like, The A-Listers, were aimed at the entertainment industry providing services to help build the brand of individual artists. While running The A-Listers, he worked with Flo Rida, Cee Lo Green and B.o.B.\u003C\u002Fp\u003E\n\u003Cp\u003EScott graduated from the United States Military Academy at West Point with a BS in Mechanical Engineering. He also served as an Airborne Ranger in the United States Army, spending most of his time in Germany as a platoon leader and company commander.\u003C\u002Fp\u003E\n"},{slug:o,name:"Bethany Schuttinga, PhD",intro:p,level:3,role:e,link:o,linkedinProfileLink:"https:\u002F\u002Fwww.linkedin.com\u002Fin\u002Fbethany-j-schuttinga-phd-54205716\u002F",image:"bethany-schuttinga-bw",tags:[k,e],toc:[],body:{type:f,children:[{type:b,tag:c,props:{},children:[{type:a,value:p}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"Bethany holds a PhD from Iowa State University, a MS from Minnesota State University and a BA from Dordt University. She is also a graduate of the Harvard Leadership Institute."}]}]},dir:g,path:"\u002Fbios\u002Fbethany-schuttinga",extension:h,createdAt:"2021-08-19T13:33:15.900Z",updatedAt:"2021-08-30T22:07:45.954Z",readingTime:25400,bodyText:"\u003Cp\u003EDr. Bethany Schuttinga has served in a variety of global executive leadership positions and has consulted for several for-profit and non-profit organizations over the past 20+ years. She served for a number of years as the Director of Judicial Affairs at Iowa State University and also worked abroad for a large multinational conglomerate in SE Asia. Within her various roles she provided expertise for C-suite and executive performance coaching, board governance, talent acquisition, economic development, strategic planning, marketing, leadership development, finance, human resources, research, technical writing, and policy analysis. Bethany is currently the President of Avail Academy.\u003C\u002Fp\u003E\n\u003Cp\u003EBethany holds a PhD from Iowa State University, a MS from Minnesota State University and a BA from Dordt University. She is also a graduate of the Harvard Leadership Institute.\u003C\u002Fp\u003E\n"}]}],fetch:{},mutations:[]}}("text","element","p","\n","Partner","root","\u002Fbios",".md","jonathan-neitzell","Jon is the founder of Anduril Partners, an investment and advisory firm focused on the application of data-driven processes. Jon has over 20 years of technology and financial services experience as a portfolio manager, chief data officer, and has served on several board and in advisory roles, including Aiera (advanced, self-learning models, augmented with human insights), Arbor Advisory Group (Investor Relations and Corporate Communications), Aptiviti (360-degree due diligence platform for decision makers), Connacht Asset Management, Crux Informatics (ETL delivery platform for normalized data ingestion), Equity Data Science (decision workflow platform), and SESAMm (modular machine learning engine for signal and investment strategy creation). He recently served as a board advisor for Prattle (investment research through quantifying language - acquired by Liquidnet), and for Kensho Technologies (artificial intelligence for financial services) the largest acquisition of its kind by S&P Global.","Anduril","Author","scott-stanley","Before returning to his entrepreneurial roots in 2020, Scott most recently spent seven years in Big Four consulting, primarily with KPMG covering large global banks. At KPMG, he drove innovation and technology initiatives and led engagements within the firm's risk practices. He established and led FinTech initiatives and partnered with best-in-class technology software companies to create joint go-to-market opportunities. He also developed an AI\u002FNLP software solution that accelerated and improved the quality of the audit\u002Freview of large volumes of technical documents.","bethany-schuttinga","Dr. Bethany Schuttinga has served in a variety of global executive leadership positions and has consulted for several for-profit and non-profit organizations over the past 20+ years. She served for a number of years as the Director of Judicial Affairs at Iowa State University and also worked abroad for a large multinational conglomerate in SE Asia. Within her various roles she provided expertise for C-suite and executive performance coaching, board governance, talent acquisition, economic development, strategic planning, marketing, leadership development, finance, human resources, research, technical writing, and policy analysis. Bethany is currently the President of Avail Academy.")));